(36, 61, 35, 67, 68, 3, 'eksempeldata-kontakt/frukt-sider/personale', 'com_contact', 'Personale', 'personale', '', '<p>Ta gjerne kontakt med v√•rt personale n√•r du trenger hjelp.</p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-14 23:16:04', 0, '*'),
(37, 62, 35, 69, 122, 3, 'eksempeldata-kontakt/frukt-sider/fruktleksikon', 'com_contact', 'Fruktleksikon', 'fruktleksikon', '', '<p>¬†</p>\r\n<p>V√•r katalog med informasjon om ulike typer frukt.</p>\r\n<p>Vi elsker frukt og √∏nsker at verden skal vite mer om alle sine mange varianter.</p>\r\n<p>Selv om den er liten n√•, jobber vi med det n√•r vi har en sjanse.</p>\r\n<p>Alle bildene finnes i <a href="http://commons.wikimedia.org/wiki/Main_Page">Wikimedia Commons</a>.</p>\r\n<p><img src="images/sampledata/fruitshop/apple.jpg" border="0" alt="Apples" title="Epler" /></p>\r\n<p><em>Dette leksikonet er implementert ved hjelp av komponenten kontakter, hver frukt er en egen kontakt og en kategori for hver bokstav. En CSS stil er brukt til √• lage den horisontale utforming av alfabetoverskriftene. </em></p>\r\n<p><em>Hvis du ville, kunne du tillate at noen brukere (for eksempel gartnerne) √• ha tilgang til akkurat denne kategorien i kontaktkomponenten og la dem hjelpe deg til √• opprette nytt innhold for leksikonet.</em></p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-15 22:55:25', 0, '*'),
