(1, 89, 'Administratorkomponenter', 'administratorkomponenter', '', '<p>Alle komponentene brukes ogs√• i administrasjonsdelen p√• din nettsiden. I tillegg til de som er listet opp her, finnes det ogs√• komponenter i administrasjonsdelen som ikke har egne vinduer p√• brukersiden. Disse er allikevel viktige da de er med √• forme utseende og opplevelsen av nettsiden. De mest viktigste for de fleste er:</p>\r\n<ul>\r\n<li>Media</li>\r\n<li>Utvidelser</li>\r\n<li>Menyer</li>\r\n<li>Konfigurasjon</li>\r\n<li>Bannere</li>\r\n<li>Omadressering</li>\r\n</ul>\r\n<hr title="Media" alt="Media" class="system-pagebreak" style="color: gray; border: 1px dashed gray;" />\r\n<p>¬†</p>\r\n<h3>Media</h3>\r\n<p>Mediakomponenten gir deg anledningen til √• laste opp og sette inn bilder i tekster p√• nettsiden din. Du kan ogs√• aktivere flash-opplaster som gir deg anledningen til √• laste opp flere bilder samtidig. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Content_Media_Manager" target="_blank">Hjelp</a></p>\r\n<hr title="Utvidelser" alt="Utvidelser" class="system-pagebreak" style="color: gray; border: 1px dashed gray;" />\r\n<h3>Utvidelser</h3>\r\n<p>Utvidelser gir deg anledningen til √• installere, oppdatere, avinstallere og administrere alle dine utvidelser. Administrasjonen av utvidelser har gjennomg√•tt en omfattende redesign for Joomla 2.5 samt at kjernefunksjonen installer og avinstaller forblir slik den var i Joomla 1.5. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Extension_Manager_Install" target="_blank">Hjelp</a></p>\r\n<hr title="Menyer" alt="Menyer" class="system-pagebreak" style="color: gray; border: 1px dashed gray;" />\r\n<h3>Menyer</h3>\r\n<p>Menybehandlingen gir deg anledningen til √• opprette menyer som du vil kunne se p√• nettsiden din. Denne komponenten gir deg ogs√• anledningen til √• tillordne moduler og malutseende til spesifikke menylenker. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Menus_Menu_Manager" target="_blank">Hjelp</a></p>\r\n<hr title="Konfigurasjon" alt="Konfigurasjon" class="system-pagebreak" style="color: gray; border: 1px dashed gray;" />\r\n<h3>Konfigurasjon</h3>\r\n<p>Nettsidens administrator kan benytte konfigurasjonskomponenten til √• justere innstillinger p√• nettsiden slik som s√∏kevennlige adresser, nettsidens metadata (beskrivende tekst som benyttes av s√∏kemoterer og indekseringssystemer) og andre innstillinger. For mange nybegynnere vil det v√¶re smart √• starte med standardinnstillingene. N√•r nettsiden skal publiseres for resten av verden b√∏r metadata justeres slik at det stemmer overrens med nettsidens innhold. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Site_Global_Configuration" target="_blank">Hjelp</a></p>\r\n<hr title="Bannere" alt="Bannere" class="system-pagebreak" style="color: gray; border: 1px dashed gray;" />\r\n<h3>Bannere</h3>\r\n<p>Bannerkomponten gir en enkel mulighet for √• vise vekslende bilder i en modul. Denne komponenten sporer ogs√• hvor mange ganger et bilde er blitt vist samt ogs√• trykket p√•. Det betyr at du kan p√• en enkel m√•te h√•ndtere annonser p√• nettsiden din. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Components_Banners_Banners_Edit" target="_blank">Hjelp</a></p>\r\n<hr title="Omadressering" class="system-pagebreak" />\r\n<h3>Omadressering</h3>\r\n<p>Komponenten for omadressering brukes til omadressering av brutte lenker hvor det ellers ville gitt; ‚ÄùSide ikke funnet‚Äù (404). Hvis denne er aktivert vil det tillate deg √• omadressere brutte koblinger til bestemte sider. Den kan ogs√• brukes til √• h√•ndtere migrasjonsrelatert nettadresseendringer. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Components_Redirect_Manager" target="_blank">Hjelp</a></p>', '', 1, 0, 0, 21, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 17:59:03', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 15, 0, 7, '', '', 1, 67, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(8, 104, 'Nybegynnere', 'nybegynnere', '', '<p>Om dette er din f√∏rste Joomlaside, eller f√∏rste nettside, er du kommet til riktig sted. Joomla vil hjelpe deg med √• f√• din nettside opp og g√•, raskt og enkelt.</p>\r\n<p>Start med √• logge inn ved hjelp av administratorkontoen du opprettet n√•r du installerte Joomla!.</p>\r\n', '\r\n<p>Utforsk artikler og andre ressurser  her p√• nettstedet for √• finne ut mer om hvordan Joomla fungerer. (N√•r du  er ferdig med √• utforske, kan du slette eller arkivere disse  eksempeldataene.) Det anbefales ogs√• at du bes√∏ker nybegynneromr√•dene p√• <a href="http://docs.joomla.org/Beginners" target="_blank">dokumentasjonssidene</a> og <a href="http://forum.joomla.org" target="_blank">forumet</a>.</p>\r\n<p>Det vil ogs√• v√¶re lurt √• melde seg p√• e-postlistene for sikkerhetsmeldinger og kunngj√∏ringer. For √• f√• inspirasjon kan du bes√∏ke visningssidene for √• se en rekke spennende m√•ter folk bruker Joomla til √• fortelle sine historier p√• nettet.</p>\r\n<p>Standardinstallasjonen av Joomla gir deg raskt et flott nettsted opp √• g√•. N√•r du er klar for flere funksjoner kommer det flotte med Joomla hvor du kan utvide nettstedet til nesten alt du m√•tte √∏nske deg. Bes√∏k <a href="http://extensions.joomla.org/" target="_blank">biblioteket av Joomlautvidelser</a> for √• se tusenvis av utvidelser som kan gj√∏re nesten alt du m√•tte √∏nske deg p√• et nettsted. Finner du ikke det du trenger? Da kan profesjonelle Joomlautviklere hjelpe deg p√• <a href="http://resources.joomla.org/" target="_blank" title="Resurskatalogen for Joomla!">resurskatalogen for Joomla!</a>.</p>\r\n<p>Vil du vite mer? Vurder √• delta p√• en <a href="http://www.joomladay.no/" target="_blank" title="Joomladagene i Norge">Joomladag</a>, annen hendelse eller bli med en lokal <a href="http://www.joomlainorge.no" target="_blank">brukergruppe for Joomla</a>. Kan du ikke finne en n√¶r deg? Start en selv.</p>', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 18:28:21', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 13, 0, 3, '', '', 1, 70, '{"robots":"","author":"","rights":"","xreference":""}', 1, '*', ''),
(2, 90, 'Arkiverte artikler', 'arkiverte-artikler', '', '<p>Denne modulen viser liste over m√•neder  som inneholder arkivert innhold. Etter at du har valgt √• arkivere en  artikkel, vil denne listen automatisk bli laget. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Articles_Archive" target="_blank" title="Archive Module">Hjelp</a></p>\r\n<p>{loadposition archiveload}</p>', '', 1, 0, 0, 64, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 18:02:09', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 8, 0, 5, 'modules, content', '', 1, 28, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(7, 103, 'Bannermodulen', 'bannermodulen', '', '<p>Bannermodulen benyttes for √• vise bannere som er administrert av bannerkomponenten i administrasjonsdelen. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Banners" target="_blank">Hjelp</a></p>\r\n<p>{loadposition bannersload}</p>', '', 1, 0, 0, 66, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 18:22:14', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 6, '', '', 1, 28, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
