(5, 101, 'Autentifisering', 'autentifisering-authentification', '', '<p>Programtillegget autentifisering arbeider n√•r brukere logger seg p√• brukersidene eller i administrasjonsdelen. Joomla-autentifisering er satt opp som standard i bruk. Du kan godt aktivere Gmail, LDAP eller installere et programtillegg for et annet system. Et eksempel er inkludert for √• kunne benyttes til √• lage et nyt autentifiseringprogramtillegg.</p>\r\n<p>Standard aktivert:</p>\r\n<ul>\r\n<li>Joomla</li>\r\n</ul>\r\n<p>Standard deaktivert:</p>\r\n<ul>\r\n<li>Gmail</li>\r\n<li>LDAP</li>\r\n</ul>', '', 1, 0, 0, 25, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 18:16:39', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 3, '', '', 1, 29, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(6, 102, 'Australske parker', 'australske-parker', '', '<p><img src="images/sampledata/parks/banner_cradle.jpg" border="0" alt="Cradle Park Banner" /></p>\r\n<p>Velkommen!</p>\r\n<p>Dette er en enkel nettside om de vakre og fasinerende parkene i Australia.</p>\r\n<p>P√• denne siden kan du lese mer om mine turer til de forskjellige parkene, se p√• bilder og finne lenker til parkenes nettsider.</p>\r\n<p><em>Denne eksempelsiden er et eksempel p√• bruk av kjernefunksjoner i Joomla for √• lage enkle nettsider, "brosjyrenettside", en personlig blog eller presentere informasjon om et eller annet emne du har interesse i.</em></p>\r\n<p><em> Les mer om nettstedet i modulen "Om parkene".</em></p>', '', 1, 0, 0, 26, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 18:21:10', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 1, '', '', 1, 77, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(9, 105, 'Kontakt', 'kontakt', '', '<p>Kontaktkomponenten gir anledningen til √• presentere kontaktskjemaer og informasjon for din nettside. Du kan ogs√• lage en kompleks katalog som kan benyttes til mange forskjellige form√•l. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Components_Contacts_Contacts" target="_blank">Hjelp</a></p>', '', 1, 0, 0, 21, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 18:30:16', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 2, '', '', 1, 31, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(10, 106, 'Innhold', 'innhold', '', '<p>Innholdskomponenten (com_content) er den funksjonen som benyttes for √• skrive artikler. Den er ekstrem fleksibel og har et stort antall av innebygde visninger. Denne komponenten gj√∏r at du p√• en veldig enkel og grei m√•te kan opprette og redigere nettsideartikler fra brukersiden. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Content_Article_Manager" target="_blank">Hjelp</a></p>', '', 1, 0, 0, 21, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 18:32:23', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 1, '', '', 1, 40, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(11, 107, 'Cradlefjellet', 'cradlefjellet', '', '<p><img src="images/sampledata/parks/landscape/250px_cradle_mountain_seen_from_barn_bluff.jpg" border="0" alt="Cradle Mountain" style="vertical-align: middle;" /></p>\r\n', '\r\n<p><img src="images/sampledata/parks/landscape/800px_cradle_mountain_seen_from_barn_bluff.jpg" border="0" alt="Cradle Mountain" style="vertical-align: middle;" /></p>\r\n<p>¬†</p>\r\n<p class="caption">Kilde: http://commons.wikimedia.org/wiki/File:Rainforest,bluemountainsNSW.jpg</p>\r\n<p class="caption">Skribent: Alan J.W.C.</p>\r\n<p class="caption">Lisens: GNU Free Documentation License v . 1.2 or later</p>', 1, 0, 0, 73, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-13 22:44:07', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 1, '', '', 1, 11, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
