(13, 111, 'Veivisere', 'veivisere', '', '<p>Slik finner du v√•r butikk.</p>\r\n<p>Ved kj√∏re bil</p>\r\n<p>Kj√∏r langs hovedgaten til krysset ved First Avenue.¬† Se da etter v√•rt skilt.</p>\r\n<p>Ved √• g√•</p>\r\n<p>Fra sentrum av byen g√•r du nordover i hovedgaten til du ser v√•rt skilt.</p>\r\n<p>Ved √• ta bussen</p>\r\n<p>Ta buss nummer 73 til siste busstopp. Vi er da i nord√∏sthj√∏rnet n√•r du g√•r ut av bussen.</p>', '', 1, 0, 0, 29, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-12 23:13:46', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 2, '', '', 1, 30, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(14, 112, 'Tekstbehandlere', 'tekstbehandlere-editors', '', '<p>Tekstbehandlere benyttes over alt i Joomla! hvor innhold er opprettet. TinyMCE er standard valget som benyttes i de fleste situasjoner. CodeMirror benyttes i administrasjonen av maler. Ingen tekstbehandler benyttes i tekstfelt for HTML innhold.</p>\r\n<p>Standard aktivert:</p>\r\n<ul>\r\n<li>CodeMirror Hjelp</li>\r\n<li>TinyMCE Hjelp</li>\r\n<li>Ingen tekstbehandler Hjelp</li>\r\n</ul>\r\n<p>Standard deaktivert:</p>\r\n<ul>\r\n<li>Ingen</li>\r\n</ul>', '', 1, 0, 0, 25, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-13 20:56:53', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 5, '', '', 1, 15, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
