(19, 117, 'Bunntekstmodul', 'bunntekstmodul', '', '<p>Denne modulen viser Joomla! kopibeskyttelsesinformasjonen. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Footer" title="Bunntekstmodul">Hjelp</a></p>\r\n<p>{loadposition footerload}</p>', '', 1, 0, 0, 66, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 21:58:18', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 3, '', '', 1, 13, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(20, 118, 'Fruktbutikk', 'fruktbutikk', '', '<h2>Velkommen til fruktbutikken</h2>\r\n<p>Vi selger frukt fra hele verden. Vennligst benytt v√•r nettside for √• finne mer ut om v√•r forretning. Vi h√•per du vil komme til v√•r butikk og kj√∏pe noe frukt.</p>\r\n<p><em>Denne mini-nettsiden vil vise deg hvordan du kan sette opp en nettside for din forretning hvis du f.eks. selger frukt. Vi vil vise hvordan du kan sette opp tilgangsniv√•er for √• kontrollere tilgangen til nettsidens innhold. Hvis du setter opp en reel nettside vil det kanskje v√¶re av interesse √• utvide funksjonaliteten med nettbutikk, en katalog, nyhetsbrev eller andre utvidelser. Mange av disse utvidelsene kan du allerede finne i </em><a href="http://extensions.joomla.org"><em>Joomla! utvidelseskatalog</em></a>.</p>\r\n<p><em>For √• f√• fullt utbytte av denne nettsiden b√∏r du nok opprette en bruker med rettigheten kundegruppe og en annen med rettigheten leverand√∏rer. Ved √• logge inn med de forskjellige brukerne vil du f√• se hvordan tilgangskontrollen fungerer.</em></p>', '', 1, 0, 0, 29, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-16 00:00:07', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 1, '', '', 1, 40, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(21, 119, 'Finne hjelp', 'finne-hjelp', '', '<p><img class="image-left" src="administrator/templates/hathor/images/header/icon-48-help_header.png" border="0" /> Det finnes mange steder du kan f√• hjelp med Joomla!.</p>\r\n<p>P√• en del sider vil du se et hjelpesymbol (r√∏d-hvit runding/livb√∏ye). Ved √• trykke p√• denne vil det da √•pnes en ny side med hjelp og informasjon om funksjonene p√• den siden du befinner deg p√•.</p>\r\n<ul>\r\n<li><a href="http://forum.joomla.org">Supportforumer</a></li>\r\n<li><a href="http://docs.joomla.org">Dokumentasjon</a></li>\r\n<li><a href="http://resources.joomla.org">Profesjonelle</a></li>\r\n<li><a href="http://shop.joomla.org/amazoncom-bookstores.html">B√∏ker</a></li>\r\n</ul>', '', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 22:42:17', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 8, '', '', 1, 26, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(22, 120, 'Komme i gang', 'komme-i-gang', '', '<p>Det er enkelt √• komme i gang med √• lage din nettside. Det vil ogs√• v√¶re lettere hvis du kjenner til noen grunnleggende ting.</p>\r\n<h3>Hva er en publiseringsl√∏sning (CMS)?</h3>\r\n<p>Et content management system (CMS) eller publiseringsl√∏sning p√• norsk,  omhandler utvikling, publisering, vedlikehold og redigering av innhold  p√• nettsider. Det inneholder verkt√∏y for √• lage, strukturere og  presentere websidene.</p>\r\n<p>P√• dette nettstedet er alt innholdet lagret i en <em>database</em>. Utseende og opplevelsen gj√∏res ved hjelp av maler (<em>template)</em>. Joomla!l√∏sningen setter sammen maler og innholdet slik at det blir presentert som en ferdig nettside.</p>\r\n<h3>Brukerside og administrasjonside</h3>\r\n<p>Nettstedet ditt har faktisk to seperate nettsteder. Brukersiden (ogs√• kalt for front end) er hva dine bes√∏kende vil se. Administrasjonsiden¬† (ogs√• kalt for back end) benyttes bare av personer som skal vedlikeholde og arbeide med selve nettstedet. Du kan f√• tilgang til administrasjonsiden ved √• tryke p√• "Sideadministrasjon" under menyen "Denne siden". Du kan ogs√• g√• direkte til administrasjonsiden ved √• legge til /administrator etter domenenavnet.</p>\r\n<p>Logg inn p√• administrasjonsiden ved √• benytte brukernavnet og passordet som ble opprettet under installasjonen av Joomla!.</p>\r\n<h3>Logge inn</h3>\r\n<p>Du kan logge inn p√• brukersiden ved √• benytte innloggingskjemaet eller logg inn lenken under menyen "Denne siden". Benytt brukernavnet og passordet som ble opprettet under installasjonen. S√• snart du har logget inn vil du f√• tilgang til √• opprette og redigere artikler.</p>\r\n<p>Under administrasjonen av ditt nettsted kan du opprette innhold som bare innloggede brukere kan se.</p>\r\n<h3>Opprette en artikkel</h3>\r\n<p>S√• snart du har logget inn vil det komme frem en ny meny.  For √• opprette en ny artikkel trykker du p√• "Skriv en artikkel" lenken i den nye menyen.</p>\r\n<p>Redigeringsvinduet for artikkel som kommer frem vil gi deg flere forskjellige valg. De to viktigste valgene vil v√¶re √• gi artikkelen en tittel og noe tekst i innholdsfeltet. For at det skal v√¶re enkelt √• finne den igjen, setter du statusen til √• v√¶re publisert. Legg den s√• gjerne i Joomla! kategorien.</p>\r\n<div>Du kan redigere en eksisterende artikkel ved √• trykke p√• redigeringssymbolet (hvis tilgjengelig).</div>\r\n<h3>L√¶r mer</h3>\r\n<p>Det finnes mye mer √• l√¶re i Joomla! for √• f√• en nettside slik du har dr√∏mt om. Du kan l√¶re mer om andre funksjoner p√• <a href="http://docs.joomla.org">Joomla! dokumentasjonsiden</a> og i <a href="http://forum.joomla.org">Joomla!forumene</a>.</p>', '', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 23:08:41', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 9, '', '', 1, 95, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(23, 121, 'Flott appelsinhagen', 'flott-appelsinhagen', '', '<p>I frukthagen v√•r dyrker vi verdens beste appelsiner samt andre sitrusfrukter som sitroner og grapefrukt. V√•r familie har stelt denne frukthage i generasjoner.</p>', '', 1, 0, 0, 30, '2011-01-01 00:00:01', 42, 'Nettredakt√∏r fruktbutikk', '2011-01-14 18:00:07', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 2, '', '', 1, 11, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(24, 122, 'Norsk Joomla!', 'joomla', '', '<p>Gratulerer, du har n√• en norsk Joomlaside. Joomla gj√∏r det enkelt √• bygge en nettside, akkurat slik du √∏nsker den ‚Äì som ogs√• er enkel √• oppdatere og vedlikeholde.</p>\r\n<p>Joomla! er en fleksibel og kraftig plattform, enten du bygger en liten side for deg selv, eller en diger side med flere hundretusen bes√∏kende. Joomla er √•pen kildekode, som betyr at du kan tilpasse l√∏sningen akkurat slik du m√•tte √∏nske.</p>\r\n<p>Den norske oversettelsen av Joomla er gjort mulig gjennom flere enkeltpersoners utrettelige innsats gjennom flere √•r, uten noen form for betaling eller motytelser¬†‚Äì annet enn gleden av √• hjelpe deg og andre ut p√• nett med norsk programvare<strong>.</strong> Og selvf√∏lgelig, et h√•p om at ogs√• du etterhvert skal se nytten og gleden i √• bidra til disse frie l√∏sningene og oversettelsene gjennom fellesskapet bygget rundt <a href="http://www.joomlainorge.no/" target="_blank" title="Bes√∏k hjemmesiden til Foreningen Joomla! i Norge">Foreningen Joomla! i Norge</a>.</p>\r\n', '\r\n<h3><br />Det er mange m√•ter du kan bidra til norsk Joomla p√•</h3>\r\n<p><img src="images/sampledata/joomlainorge/knapper/bidra.png" border="0" alt="Hvordan bidra til norsk Joomla!" title="Hvordan bidra til norsk Joomla!" style="margin-left: 5px; border: 0pt none; float: right;" />Den mest verdifulle m√•ten du kan bidra p√• er med din tid. Dette kan v√¶re √• hjelpe andre i <a href="http://forum.joomla.org/viewforum.php?f=97" target="_blank" title="Vis de norske forumene p√• joomla.org">forumene</a>, delta aktivt i det norske samfunnet p√• <a href="http://www.joomlainorge.no/brukere" target="_blank" title="Vis den norske m√∏teplassen for Joomlabrukerne">joomlainorge.no/brukere</a> m.m.<br /><a href="http://www.joomlainorge.no/foreningen/hvordan-bidra" target="_blank" title="Vis mer om hvordan jeg kan bidra">Les mer om √• bidra ‚Ä¶</a></p>\r\n<p><img src="images/sampledata/joomlainorge/knapper/deloversettelse.png" border="0" alt="Del din norske oversettelse for Joomlautvidelser" title="Del din norske oversettelse for Joomlautvidelser" style="margin-left: 5px; border: 0pt none; float: right;" />Man beh√∏ver bare en gratis brukerkonto p√• <a href="http://www.joomlainorge.no/" target="_blank" title="Vis Foreningen Joomla! i Norges nettside">joomlainorge.no</a> for √• laste oversatte spr√•kfiler direkte opp i filarkivet, og man kan ogs√• sende filene inn via e-post.<br /><a href="http://www.joomlainorge.no/foreningen/hvordan-bidra/569-hvordan-bidra-med-oversettelser" target="_blank" title="Vis mer om hvordan jeg kan bidra med med oversettelser">Les mer om √• bidra med oversettelser ‚Ä¶</a></p>\r\n<p><img src="images/sampledata/joomlainorge/knapper/blimedlem.png" border="0" alt="Bli medlem i foreningen Joomla! i Norge" title="Bli medlem i foreningen Joomla! i Norge" style="margin-left: 5px; border: 0pt none; float: right;" />Ved medlemskap st√∏tter du ikke bare driften av foreningen, men ogs√• Joomla ettersom mesteparten av kontingenten f√∏res tilbake til medlemmene i form av st√∏tte til Joomla.<br /><a href="http://www.joomlainorge.no/foreningen/medlemskap" target="_blank" title="Vis mer om medlemskap i Foreningen Joomla! i Norge">Les mer om medlemskap i foreningen ‚Ä¶</a></p>\r\n<p>¬†</p>\r\n<h3>Om Foreningen Joomla! i Norge</h3>\r\n<p><a href="http://w2.brreg.no/enhet/sok/detalj.jsp?orgnr=990126658" target="_blank" title="Oppf√∏ring i Br√∏nn√∏ysund">Foreningen Joomla! i Norge ble stiftet i 2006</a> med form√•l √• v√¶re en partsn√∏ytral forening for oversettere, brukere og leverand√∏rer av Joomla! her i landet.</p>\r\n<p>Alt arbeidet som foreningen utf√∏rer er i form av en felles dugnadsinnsats mellom foreningens medlemmer og brukere. Det er foreningens betalende medlemmer som er "Foreningen Joomla! i Norge". Dette er en <a href="http://no.wikipedia.org/wiki/Ideell_organisasjon" target="_blank" title="Om ideelle organisasjoner p√• Wikipedia">ideell/frivillig organisasjon</a> hvor ingen har l√∏nn for sitt arbeide.</p>\r\n<p>Foreningen arbeider for √• utbre bruken av <a href="http://www.joomlainorge.no/foreningen/om-joomla" target="_blank" title="Vis mer om Joomla! publiseringsl√∏sning">Joomla! publiseringsl√∏sning</a>, og bidrar til dette ved √• oversette til norsk, samt dokumentere bruk av denne l√∏sningen.</p>\r\n<p><a href="Informasjon%20om%20Joomla!%20User%20Groups" target="_blank" title="Informasjon om Joomla! Translation Teams"><img src="images/sampledata/joomlainorge/joomla_transteam_sm.png" border="0" alt="joomla_transteam_sm.png" title="joomla_transteam_sm.png" style="margin-left: 5px; border: 0pt none; float: right;" /></a>Foreningen Joomla! i Norge, ved koordinator Rune Rasmussen, er registrert som den norske oversettelsesgruppen for Joomla!. <a href="http://community.joomla.org/translations.html" target="_blank" title="Les mer om oversettelsesgruppene her">Les mer om oversettelsesgruppene her ...</a></p>\r\n<p><a href="http://community.joomla.org/user-groups.html" target="_blank" title="Informasjon om Joomla! User Groups"><img src="images/sampledata/joomlainorge/joomla_rug_sm.png" border="0" alt="joomla_rug_sm.png" title="joomla_rug_sm.png" style="margin-left: 5px; border: 0pt none; float: right;" /></a>Foreningen Joomla! i Norge er ogs√• registrert som en norsk brukergruppe/-forening for Joomla i Norge. <a href="http://community.joomla.org/user-groups.html" target="_blank" title="Les mer om, og finn andre, brukergrupper her.">Les mer om, og finn andre, brukergrupper her ...</a></p>', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2012-01-29 15:10:45', 42, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 61, 0, 2, '', '', 1, 173, '{"robots":"","author":"","rights":"","xreference":""}', 1, '*', ''),
(25, 123, 'Koala', 'koala', '', '<p><img src="images/sampledata/parks/animals/180px_koala_ag1.jpg" border="0" alt="Koala  Thumbnail" width="180" height="123" style="vertical-align: middle; border: 0;" /></p>\r\n', '\r\n<p><img src="images/sampledata/parks/animals/800px_koala_ag1.jpg" border="0" alt="Koala Climbing Tree" width="500" height="341" style="vertical-align: middle; border: 0;" /></p>\r\n<p>¬†</p>\r\n<p>¬†</p>\r\n<p class="caption">Kilde: http://commons.wikimedia.org/wiki/File:Koala-ag1.jpg</p>\r\n<p class="caption">Skribent: Arnaud Gaillard</p>\r\n<p><span class="caption">Lisens: Creative Commons Share Alike Attribution Generic 1.0</span></p>', 1, 0, 0, 72, '2011-01-01 00:00:01', 42, 'Nettredakt√∏r parker', '2011-01-13 22:30:17', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 2, '', '', 1, 16, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(26, 124, 'Spr√•kbyttemodul', 'sprakbyttemodul', '', '<p>Spr√•kbyttemodulen gir deg anledningen til √• arbeide med flerspr√•klige funksjoner som er tilgjengelig n√•r innhold, moduler og menyer blir opprettet.</p>\r\n<p>Denne modulen vil vise en liste over tilgjengelige innholdsspr√•k slik at man kan bytte mellom dem.</p>\r\n<p>Ved bytte av spr√•k vil fremsiden bli byttet til det valgte spr√•ket. Deretter vil all navigering p√• sidene f√∏lge det spr√•ket som er valgt.</p>\r\n<p><strong>Programtillegget spr√•kfilter m√• v√¶re aktivert for at denne modulen skal kunne fungere skikkelig.</strong></p>\r\n<p><strong></strong> <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Language_Switcher" title="Spr√•kbyttemodul">Hjelp</a></p>\r\n<p>For √• se eksempel p√• spr√•kbyttemodulen m√• du g√• til administrasjonsiden og sl√• p√• programtillegget spr√•kfilter. Deretter m√• du ogs√• sl√• p√• modulen "Spr√•kbytte". Deretter kan du se p√• eksempelsidene fruktbutikken eller parker. F√∏lg deretter¬†<a href="http://docs.joomla.org/Language_Switcher_Tutorial_for_Joomla_1.6">instruksjonene i denne veiledningen</a>.</p>', '', 1, 0, 0, 67, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 23:44:44', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 3, '', '', 1, 18, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(27, 125, 'Siste artikler', 'siste-artikler', '', '<p>Denne modulen viser en liste over de  siste aktive artiklene (noen artikler kan v√¶re utl√∏pt p√• dato selv om de  er blant de siste artiklene). <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Latest_News" title="Latest Articles">Hjelp</a></p>\r\n<p>{loadposition articleslatestload}</p>', '', 1, 0, 0, 64, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 21:20:44', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 1, 'modules, content', '', 1, 16, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(28, 126, 'Innloggingsmodul', 'innloggingsmodul', '', '<p>Denne modulen viser et skjem for √• angi brukernavn og passord. Den viser ogs√• en lenke for √• gjenopprette et glemt passord. Hvis brukerregistrering er aktivert (i Global Konfigurasjon), vil ogs√• en lenke for registrering bli vist. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Login" title="Innlogging">Hjelp</a></p>\r\n<p>{loadposition loginload}</p>', '', 1, 0, 0, 65, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 21:54:11', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 2, '', '', 1, 14, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(29, 127, 'Menymodulen', 'menymodulen', '', '<p>Denne modulen viser menyer p√• siden (brukersiden). Menyer kan vises p√• en rekke forskjellige m√•ter ved hjelp av menyvalgene og css menystiler. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Menu">Hjelp</a></p>\r\n<p>{loadposition menuload}</p>', '', 1, 0, 0, 75, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 21:47:37', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 1, '', '', 1, 17, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(30, 128, 'Mest leste innhold', 'mest-leste-innhold', '', '<p>Denne modulen viser en liste over publiserte artikler som har blitt lest flest ganger. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Most_Read" title="Most Read Content">Hjelp</a></p>\r\n<p>{loadposition articlespopularload}</p>', '', 1, 0, 0, 64, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 21:22:31', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 2, 'modules, content', '', 1, 13, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(31, 129, 'Siste nyheter', 'siste-nyheter', '', '<p>Denne modulen viser et gitt antall artikler fra en kategori bestemt p√• dato eller et tilfeldig valg. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Articles_Newsflash" title="Nyhetsmodul">Hjelp</a></p>\r\n<p>{loadposition newsflashload}</p>', '', 1, 0, 0, 64, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 21:28:44', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 3, 'modules, content', '', 1, 19, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(32, 130, 'Parametre', 'parametre', '', '<p>Etter hvert som du lager ditt Joomla! nettsted med bruk av utvidelsene vil du kontrollere detaljene i visningen ved hjelp av <em>parametrene</em><strong></strong>. Parametrene styrer alt fra om skribentens navn skal vises til hvem som kan se hva til antall elementer som vises i listene.</p>\r\n<p>Standard parametrene for hver komponent endres ved hjelp av knappen innstillinger p√• komponenten verkt√∏ylinjen.</p>\r\n<p>Parametrene kan ogs√• settes p√• et enkelt element, slik som for en artikkel eller kontakt og i menyene.</p>\r\n<p>Hvis du er forn√∏yd med hvordan nettsiden ser ut, er det greit √• la alle parametrene v√¶re slik de er satt n√•r nettstedet ble installert. Etter hvert som du blir mer erfaren med Joomla! vil du bruke parametrene mer.</p>', '', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 21:36:08', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 10, '', '', 1, 37, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
