(35, 133, 'Profesjonelle', 'profesjonelle', '', '<p>Joomla! 2.5 videref√∏rer utviklingen av Joomlas rammeverk og CMS, som en sterk og fleksibel m√•te √• virkeliggj√∏re dine visjoner for Internett. N√• som administrasjonen er fullt ut MVC, er muligheten til √• kontrollere dens utseende og behandlingen av utvidelser komplett.</p>\r\n', '\r\n<p>√Ö jobbe med flere malstiler og overstyring for de samme visningene,√•  skape det designet du √∏nsker er n√• lettere enn det noen gang har v√¶rt.  Begrense st√∏tte til PHP 5.2.4 og over og avslutte bakoverkompabilitet for Joomla 1.0 utvidelser gj√∏r  Joomla! lettere og raskere enn noensinne. Spr√•kfiler kan n√• overstyres  uten at endringene g√•r tapt under en oppgradering. Med riktig xml,  oppdateres dine utvidelser med et enkelt klikk.</p>\r\n<p>Adgangskontroll (ACL) er n√• inkorporert ved bruk av et nytt system  utviklet for Joomla! ACL systemet er designet med utviklere i tankene,  s√• det blir enkelt √• innlemme i dine utvidelser. Det nye nestede  biblioteket tillater deg √• innlemme uendelig dybde i kategorier, men  ogs√• √• bruke nestede sett p√• en rekke andre m√•ter.</p>\r\n<p>Et nytt skjemabibliotek gj√∏r oppretting av alle typer brukerinteraksjon enkel. MooTools 1.3 gir et sv√¶rt fleksibelt javaskript rammeverk som er et stort fremskritt over MooTools 1.0..</p>\r\n<p>Les mer om:</p>\r\n<ul>\r\n<li><a href="http://docs.joomla.org/What''s_new_in_Joomla_1.6">Endringer siden 1.5</a></li>\r\n<li><a href="http://docs.joomla.org/ACL_Tutorial_for_Joomla_1.6">Jobbe med ACL</a></li>\r\n<li><a href="http://docs.joomla.org/API16:JCategories">Jobbe med nestede kategorier</a></li>\r\n<li><a href="http://docs.joomla.org/API16:JForm">Bruke skjemabiblioteket</a></li>\r\n<li><a href="http://docs.joomla.org/Working_with_Mootools_1.3">Jobbe med Mootools 1.3</a></li>\r\n<li><a href="http://docs.joomla.org/Layout_Overrides_in_Joomla_1.6">Bruke nye muligheter med overstyring</a></li>\r\n<li><a href="http://docs.joomla.org/API16:Framework">Joomla! 2.5 API</a>I</li>\r\n<li><a href="http://docs.joomla.org/API16:JDatabaseQuery">Bruke JDatabaseQuery</a></li>\r\n<li><a href="http://docs.joomla.org/What''s_new_in_Joomla_1.6#Events">Hva er nytt og hva er oppdatert i J2.5</a></li>\r\n<li><a href="http://docs.joomla.org/Xml-rpc_changes_in_Joomla!_1.6">Xmlrpc</a></li>\r\n<li><a href="http://docs.joomla.org/What''s_new_in_Joomla_1.6#Extension_management">Installere og oppdatere utvidelser</a></li>\r\n<li><a href="http://docs.joomla.org/Setting_up_your_workstation_for_Joomla!_development">Sette opp utviklingsmilj√∏</a></li>\r\n</ul>', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-12 23:19:47', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 7, 0, 6, '', '', 1, 56, '{"robots":"","author":"","rights":"","xreference":""}', 1, '*', ''),
(36, 134, 'Modul Tilfeldig bilde', 'modul-tilfeldig-bilde', '', '<p>Denne modulen viser tilfeldige bilder fra en valgt mappe med bilder. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Random_Image" title="Modul tilfeldig bildee">Hjelp</a></p>\r\n<p>{loadposition randomimageload}</p>', '', 1, 0, 0, 66, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 21:18:20', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 4, '', '', 1, 24, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(37, 135, 'Relaterte artikler', 'relaterte-artikler', '', '<p>Denne modulen viser andre artikler som  er relatert til den artiklen som for tiden vises. Det er artiklenes  n√∏kkelord som bestemmer. Alle n√∏kkelord i den aktive artiklen blir sammenliknet med n√∏kkelord i alle de andre publiserte artiklene. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Articles_Related" title="Modul relaterte artikler">Hjelp</a></p>\r\n<p>{loadposition relateditemsload}</p>', '', 1, 0, 0, 64, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 21:33:55', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 4, 'modules, content', '', 1, 18, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(38, 136, 'Demosider', 'demosider', '', '<p>Denne installasjonen inneholder eksempeldata laget for √• vise deg noen av alternativene du har for √• bygge ditt nettsted. I tillegg til informasjon om Joomla! er det to eksempelsider ‚Äùinnenfor et nettsted" laget for √• hjelpe deg i gang med √• lage ditt eget nettsted.</p>\r\n<p>Det f√∏rste omr√•det er en enkel side om <a href="index.php?Itemid=243">australske parker</a>. Det viser deg at du raskt og enkelt kan bygge et personlig omr√•de med bare de byggeklossene som er en del av Joomla! Det omfatter en personlig blogg, nettlenke, og et veldig enkel bildegalleri.</p>\r\n<p>Den andre siden er litt mer komplisert og viser hva du kan gj√∏re hvis du bygger et nettsted for en liten bedrift, i dette tilfellet en <a href="index.php/welcome.html"></a><a href="index.php?Itemid=429">fruktbutikk</a>.</p>\r\n<p>Uansett type nettsted du √∏nsker √• lage √∏nsker du mest sannsynlig √• legge til <a href="http://extensions.joomla.org">utvidelser</a> og enten lage eller kj√∏pe din egen mal. Mange Joomla! brukere starter ved √• endre <a href="http://docs.joomla.org/How_do_you_modify_a_template%3F"> malene</a> som f√∏lger med kjerneinstallasjonen slik at de inkluderer spesielle bilder og andre designelementer som er relatert til ditt nettsted.</p>', '', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 21:14:45', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 11, '', '', 1, 126, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(39, 137, 'S√∏k', 'soke-komponenten', '', '<p>S√∏kekomponenten gir grunnleggende s√∏kefunksjonalitet for informasjonen fra dine kjernekomponenter. Mange tredjepartsutvidelser bruker ogs√• s√∏kekomponenten. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Components_Search">Hjelp</a></p>', '', 1, 0, 0, 21, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 20:50:09', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 3, '', '', 1, 34, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(40, 138, 'S√∏kemodul', 'sokemodul', '', '<p>Denne modulen vil vise en s√∏keboks. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Search" title="S√∏k">Hjelp</a></p>\r\n<p>{loadposition searchload}</p>', '', 1, 0, 0, 67, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 20:37:19', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 4, '', '', 1, 14, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(41, 139, 'S√∏k', 'sok-programtillegg', '', '<p>S√∏ke komponenten bruker programtillegg for √• kontrollere hvilke deler av ditt Joomla! omr√•det som er s√∏kbart. Du kan velge √• sl√• av noen omr√•der for √• forbedre ytelsen eller av andre grunner. Mange tredjeparts utvidelser har egne s√∏keprogramtillegg som utvider s√∏keomr√•det.</p>\r\n<p>Standard aktivert:</p>\r\n<ul>\r\n<li>Innhold Hjelp</li>\r\n<li>Kontakter Hjelp</li>\r\n<li>Nettlenker¬†Hjelp</li>\r\n<li>Nyhetsmatning¬†Hjelp</li>\r\n<li>Kategorier¬†Hjelp</li>\r\n</ul>', '', 1, 0, 0, 25, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 20:44:20', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 1, '', '', 1, 19, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(42, 140, 'Nettstedskart', 'site-map', '', '<p>{loadposition sitemapload}</p>\r\n<p><em>Ved √• legge alt innholdet ditt inn i nestede kategorier kan du gi brukere og s√∏kemotorer tilgang til alt med √• bruke menyer.</em></p>', '', 1, 0, 0, 14, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 20:27:36', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 1, '', '', 1, 72, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(43, 141, 'Prikkete pungdyr', 'prikkete-pungdyr', '', '<p><img src="images/sampledata/parks/animals/220px_spottedquoll_2005_seanmcclean.jpg" border="0" alt="Spotted Quoll" style="vertical-align: middle; border: 0;" /></p>\r\n', '\r\n<p><img src="images/sampledata/parks/animals/789px_spottedquoll_2005_seanmcclean.jpg" border="0" alt="Spotted Quoll" style="vertical-align: middle;" /></p>\r\n<p>¬†</p>\r\n<p>Kilde: http://en.wikipedia.org/wiki/File:SpottedQuoll_2005_SeanMcClean.jpg</p>\r\n<p>Skribent: Sean McClean</p>\r\n<p>Lisens: GNU Free Documentation License v 1.2 or later</p>', 1, 0, 0, 72, '2011-01-01 00:00:01', 42, 'Nettredakt√∏r parker', '2011-01-13 22:27:06', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 4, '', '', 1, 15, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(44, 142, 'Statistikkmodulen', 'statistikkmodulen', '', '<p>Statistikkmodulen viser informasjon om din server sammen med statistikk p√• brukere, antall artikler i databasen og antall nettlenker.</p>\r\n<p>{loadposition statisticsload}</p>', '', 1, 0, 0, 67, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 20:22:47', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 5, '', '', 1, 19, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(45, 143, 'Syndikatmodulen', 'syndikatmodulen', '', '<p>Med syndikatmodulen kan du vise en kobling som lar brukerne hente nyheter fra side. Det vil kun vises p√• sider som nyhetsmatning er mulig. Det betyr at den ikke vil vises p√• en enkel artikkel, kontakt eller nettlenkesider, slik som denne. <a href="http://docs.joomla.org/Help15:Screen.modulessite.edit.15#Syndicate" title="Synicate Module">Hjelp</a></p>\r\n<p>{loadposition syndicateload}</p>', '', 1, 0, 0, 67, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 23:48:20', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 6, '', '', 1, 11, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(46, 144, 'System', 'system', '', '<p>Programtilleggene System opererer hver gang en side p√• nettstedet ditt lastes. De kontrollerer slike ting som nettadresser, om brukerne kan huke av for "husk meg" p√• innloggingsmodulen, og om bufring er aktivert. Nytt i 2.5 er programtillegget for omadressering som sammen med komponenten for omadressering hjelper deg med √• h√•ndtere endringer i nettadresser.</p>\r\n<p>Standard aktivert:</p>\r\n<ul>\r\n<li>Husk meg Hjelp</li>\r\n<li>SEF¬†Hjelp</li>\r\n<li>Feils√∏king¬†Hjelp</li>\r\n</ul>\r\n<p>Standard deaktivert:</p>\r\n<ul>\r\n<li>Mellomlagring¬†Hjelp</li>\r\n<li>Logg¬†Help</li>\r\n<li>Omadressering¬†Hjelp</li>\r\n</ul>', '', 1, 0, 0, 25, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 20:19:19', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 2, '', '', 1, 17, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(47, 145, 'Joomla!-samfunnet', 'joomla-samfunnet', '', '<p>Joomla! betyr ‚Äùsom en helhet‚Äù, og er et fellesskap av mennesker som arbeider og har det g√∏y sammen som gj√∏r Joomla! mulig. Tusenvis av mennesker deltar hvert √•r i Joomla!-samfunnet, og vi h√•per du vil v√¶re en av dem.</p>\r\n<p>Folk med alle typer ferdigheter, p√• alle ferdighetsniv√•er og fra hele verden er velkommen til √• delta. Delta i <a href="http://joomla.org">Joomla.org</a> familien av nettsteder (<a href="http://forum.joomla.org">Forumet </a>er et flott sted √• starte). Kom til et <a href="http://community.joomla.org/events.html">Joomla! arrangement</a>. Delta i eller starte en <a href="http://community.joomla.org/user-groups.html">Joomla! brukergruppe</a>. Enten du er utvikler, administrator, designer, sluttbruker eller fan, det finnes m√•ter for alle √• delta og bidra.</p>', '', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-16 21:22:41', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 4, '', '', 1, 52, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(48, 146, 'Joomla!-prosjektet', 'joomla-prosjektet', '', '<p>Joomla-prosjektet best√•r av alle de menneskene som lager og st√∏tter Joomla! plattformen og publiseringsl√∏sningen.</p>\r\n<p>V√•r misjon er √• tilby en fleksibel plattform for digital publisering og samarbeid.</p>\r\n<p>Kjerneverdiene:</p>\r\n<ul>\r\n<li>Frihet</li>\r\n<li>Likestilling</li>\r\n<li>Tillit</li>\r\n<li>Fellesskapet</li>\r\n<li>Samarbeid</li>\r\n<li>Brukervennlighet</li>\r\n</ul>\r\n<p>I v√•r visjon, ser vi:</p>\r\n<ul>\r\n<li>Folk publiserer og samarbeid i sine lokale samfunn rundt om i verden</li>\r\n<li>Programvare som er gratis, sikker og av h√∏y kvalitet</li>\r\n<li>Et samfunn som er hyggelig og givende √• delta i</li>\r\n<li>Folk rundt i verden bruke sitt foretrukne spr√•k</li>\r\n<li>Et prosjekt som fungerer selvstendig</li>\r\n<li>Et prosjekt som er sosialt ansvarlig</li>\r\n<li>Et prosjekt dedikert til √• opprettholde tillit fra sine brukere</li>\r\n</ul>\r\n<p>Det finnes millioner av brukere over hele verden og tusener av mennesker som bidrar til Joomla! prosjektet. De arbeider i tre hovedgrupper: produksjon gruppen, er ansvarlig for alt som g√•r inn programvaren og dokumentasjonen; Fellesskapsgruppen, ansvarlig for √• opprette og pleie fellesskapet, og Open Source Matters, den ideelle organisasjon som er ansvarlig for √• administrere juridiske, √∏konomiske og organisatoriske sp√∏rsm√•l.</p>\r\n<p>Joomla! er en fri og √•pent kildekode-prosjekt, som bruker GNU General Public License versjon 2 eller senere.</p>', '', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 19:48:59', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 1, '', '', 1, 63, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(49, 147, 'Typografi', 'typografi', '', '<h1>H1 ABCDEFGHIJKLMNOPQRSTUVWXYZ√Ü√ò√Ö abcdefghijklmonpqrstuvwzyz√¶√∏√•</h1>\r\n<h2>H2 ABCDEFGHIJKLMNOPQRSTUVWXYZ√Ü√ò√Ö abcdefghijklmonpqrstuvwzyz√¶√∏√•</h2>\r\n<h3>H3 ABCDEFGHIJKLMNOPQRSTUVWXYZ√Ü√ò√Ö abcdefghijklmonpqrstuvwzyz√¶√∏√•</h3>\r\n<h4>H4 ABCDEFGHIJKLMNOPQRSTUVWXYZ√Ü√ò√Ö abcdefghijklmonpqrstuvwzyz√¶√∏√•</h4>\r\n<h5>H5 ABCDEFGHIJKLMNOPQRSTUVWXYZ√Ü√ò√Ö abcdefghijklmonpqrstuvwzyz√¶√∏√•</h5>\r\n<h6>H6 ABCDEFGHIJKLMNOPQRSTUVWXYZ√Ü√ò√Ö abcdefghijklmonpqrstuvwzyz√¶√∏√•</h6>\r\n<p>Mikkel Rev, satt og skrev, p√• ei lita tavle. MIKKEL REV, SATT OG SKREV, P√Ö EI LITA TAVLE</p>\r\n<ul>\r\n<li>Punkt</li>\r\n<li>Punkt</li>\r\n<li>Punkt<br /> \r\n<ul>\r\n<li>Punkt</li>\r\n<li>Punkt</li>\r\n<li>Punkt<br /> \r\n<ul>\r\n<li>Punkt</li>\r\n<li>Punkt</li>\r\n<li>Punkt</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<ol>\r\n<li>Punkt</li>\r\n<li>Punkt</li>\r\n<li>Punkt<br /> <ol>\r\n<li>Punkt</li>\r\n<li>Punkt</li>\r\n<li>Punkt<br /><ol>\r\n<li>Punkt</li>\r\n<li>Punkt</li>\r\n<li>Punkt</li>\r\n</ol></li>\r\n</ol> </li>\r\n</ol>', '', 1, 0, 0, 23, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 15:38:16', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 1, '', '', 1, 66, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(50, 148, 'Oppgradere', 'oppgradere', '', '<p>Om du er en erfaren Joomla! 1.5 bruker vil 2.5 v√¶re kjent. Det er nye designmaler og forbedret brukergrensesnitt, men de fleste funksjoner er like. De st√∏rste endringene er forbedret tilgangskontroll (ACL) og kategoriniv√•er.</p>\r\n', '\r\n<p>Den nye brukerbehandleren lar deg styre hvem som har tilgang til hva p√•  nettstedet ditt. Du kan la tilgangsgrupper v√¶re akkurat slik du hadde  dem i Joomla 1.5 eller gj√∏re dem s√• komplisert som du vil. Du kan l√¶re  mer om hvordan <a href="http://docs.joomla.org/ACL_Tutorial_for_Joomla_1.6">adgangskontroll fungerer</a> p√• <a href="http://docs.joomla.org">dokumentasjonssidene</a></p>\r\n<p>I Joomla 1.5 og 1.0 ble innholdet organisert i seksjoner og kategorier. I  2.5 er seksjoner borte, men du kan opprette kategorier innen  kategorien, og ha s√• mange niv√• som du vil. Eksempeldataene gir mange  eksempler p√• bruk av nestede kategorier.</p>\r\n<p>Alle utforming er redesignet for bedre tilgjengelighet og fleksibilitet.  Hvis du √∏nsker √• beholde 1.5 oppsett, kan du finne dem i html-mappen p√•  malen MilkyWay. Det er bare √• kopier oppsett du vil ha til html-mappen i  malen du bruker.</p>\r\n<p>Oppdatering av nettstedet og utvidelsene er enklere enn noensinne takket v√¶re forbedringene i installasjonen.</p>', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-12 23:19:36', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 6, 0, 5, '', '', 1, 52, '{"robots":"","author":"","rights":"","xreference":""}', 1, '*', ''),
(51, 149, 'Bruker', 'bruker-programtillegg', '', '<p>Standard p√•:</p>\r\n<ul>\r\n<li>Joomla Hjelp</li>\r\n</ul>\r\n<p>Standard av:</p>\r\n<p>To nye programtillegg er tilgjengelig i 2.5, men er som standard deaktivert.</p>\r\n<ul>\r\n<li>Opprette kontakter Hjelp<br />Oppretter en ny lenket kontakt for hver nye bruker som opprettes. </li>\r\n<li>Profil Hjelp<br />Med dette profilprogramtillegget (som et eksempel) kan du sette inn flere felt i brukerregistreringen og visning av profilen. Dette er ment som et eksempel p√• hvilke typer felt du kan √∏nske √• opprette til profilen. </li>\r\n</ul>', '', 1, 0, 0, 25, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 22:38:55', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 4, '', '', 1, 31, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(52, 150, 'Brukere', 'brukerkomponenten', '', '<p>Brukerkomponenten lar bes√∏kende p√• nettstedet registrere seg, logg inn og ut, endre passord og annen informasjon, og gjenopprette glemt passord. I administrasjonen tillater det deg √• opprette, blokkere og administrere brukere og opprette brukergrupper og tilgangsniv√•er. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Users_User_Manager">Hjelp</a></p>\r\n<p>V√¶r oppmerksom p√• at enkelte av elementene ikke vil vises hvis du ikke er logget inn p√• nettstedet.</p>', '', 1, 0, 0, 21, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-13 23:15:55', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 5, '', '', 1, 29, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(53, 151, 'Bruke Joomla!', 'bruke-joomla', '', '<p>Med Joomla! kan du lage alt fra en enkel personlig nettside til en kompleks side med netthandel eller sosialt nettsted med millioner av bes√∏kende.</p>\r\n<p>Denne delen av eksempeldata gir deg en kort innf√∏ring i Joomla! konseptet og referansematerialet for √• hjelpe deg √• forst√• hvordan Joomla! fungerer.</p>\r\n<p><em>N√•r du ikke lenger trenger eksempeldata, trenger du bare avpublisere kategorien for eksempeldata som finnes i hver utvidelse i administrasjonen eller du kan slette alle elementene og alle kategoriene fullstendig. </em></p>', '', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 23:09:42', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 7, '', '', 1, 64, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(54, 152, 'Nettlenker', 'nettlenker', '', '<p>Nettlenker (com_weblinks) er en komponent som gir en strukturert m√•te √• organisere eksterne lenker og presentere dem p√• en visuelt attraktiv, konsekvent og informativ m√•te. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Components_Weblinks_Links">Hjelp</a></p>', '', 1, 0, 0, 21, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-13 22:47:25', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 6, '', '', 1, 25, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(55, 153, 'Nettlenkemodul', 'nettlenkemodul', '', '<p>Denne modulen viser en liste over lenker i en kategori. ¬†<a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Weblinks" title="Modul Nettlenker">Hjelp</a></p>\r\n<p>{loadposition weblinksload}</p>', '', 1, 0, 0, 66, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-13 22:51:02', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 5, '', '', 1, 9, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(56, 154, 'Bes√∏kende', 'besokende', '', '<p>Modulen Bes√∏kende viser antall anonyme brukere (f. eks gjester) og registrerte brukere (de som er innlogget) som er p√• siden akkurat n√•. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Who_Online" title="Bes√∏kende">Hjelp</a></p>\r\n<p>{loadposition whosonlineload}</p>', '', 1, 0, 0, 65, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 21:51:28', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 1, '', '', 1, 18, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(57, 155, 'Wobbegone', 'wobbegone', '', '<p><img src="images/sampledata/parks/animals/180px_wobbegong.jpg" border="0" alt="Wobbegone" style="vertical-align: middle; border: 0;" /></p>\r\n', '\r\n<p><img src="images/sampledata/parks/animals/800px_wobbegong.jpg" border="0" style="vertical-align: middle; border: 0;" /></p>\r\n<p>Kilde: http://en.wikipedia.org/wiki/File:Wobbegong.jpg</p>\r\n<p>Skribent: Richard Ling</p>\r\n<p>Rettigheter: GNU Free Documentation License v 1.2 or later</p>', 1, 0, 0, 72, '2011-01-01 00:00:01', 42, 'Nettredakt√∏r parker', '2011-01-13 22:48:52', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 1, '', '', 1, 13, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(58, 156, 'Herlige vannmeloner', 'herlige-vannmeloner', '', '<p>Vannmelon er en fantastisk og sunn godbit. Vi dyrker verdens s√∏teste vannmeloner. Vi har den st√∏rste vannmelon√•keren i v√•rt land.</p>', '', 1, 0, 0, 30, '2011-01-01 00:00:01', 42, 'Nettredakt√∏r fruktbutikk', '2011-01-13 22:13:56', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 1, '', '', 1, 17, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(59, 157, 'Modul for integrert ramme', 'modul-integrert-ramme', '', '<p>Denne modulen viser et vindu med integrert ramme til angitt sted. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Wrapper" title="Modulen Integrert ramme">Hjelp</a></p>\r\n<p>{loadposition wrapperload}</p>', '', 1, 0, 0, 67, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 22:01:06', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 1, '', '', 1, 16, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(60, 158, 'Nyhetsmatinger', 'nyhetsmatinger', '', '<p>Nyhetsmatinger (com_newsfeeds) gir en m√•te √• organisere og presentere nyhetsmatinger. Nyhetsmating er en m√•te √• presentere informasjon fra et annet omr√•de p√• ditt nettsted. For eksempel har nettsiden joomla.org mange matinger som du kan vise p√• nettstedet ditt. Du kan bruke menyene til √• presentere en enkel mating, en liste med matinger i en kategori, eller en liste over alle matingskategorier. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Components_Newsfeeds_Feeds">Hjelp</a></p>', '', 1, 0, 0, 21, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 20:40:59', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 4, '', '', 1, 25, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(61, 159, 'Br√∏dsmulemodulen', 'brodsmulemodulen', '', '<p>Br√∏dsmuler viser sidesti for brukere for √• kunne navigere seg igjennom nettstedet. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Breadcrumbs" title="Br√∏dsmulemodulen">Hjelp</a></p>\r\n<p>{loadposition breadcrumbsload}</p>', '', 1, 0, 0, 75, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 21:46:27', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 2, '', '', 1, 16, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(62, 160, 'Innhold', 'innhold-content', '', '<p>Programtilleggene innhold kj√∏rer n√•r spesifike type sider lastes. Disse gj√∏r forskjellige ting fra √• beskytte e-postadresser fra √• bli fanget opp av bestemte s√∏kemotorer til √• lage sideskift i innholdet.</p>\r\n<p>Standard aktivert:</p>\r\n<ul>\r\n<li>E-postmaskering</li>\r\n<li>Laster moduler Hjelp</li>\r\n<li>Sideskift Hjelp</li>\r\n<li>Sidenavigering Hjelp</li>\r\n<li>Vurdering Hjelp</li>\r\n</ul>\r\n<p>Standard deaktivert:</p>\r\n<ul>\r\n<li>Uthever formatkoder (Geshi) Hjelp</li>\r\n</ul>', '', 1, 0, 0, 25, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-13 20:59:36', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 7, '', '', 1, 20, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
