(66, 165, 'Modul nyeste brukere', 'modul-nyeste-brukere', '', '<p>Denne modulen viser siste registrerte brukere. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Latest_Users">Hjelp</a></p>\r\n<p>{loadposition userslatestload}</p>', '', 1, 0, 0, 65, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 21:57:15', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"1","link_titles":"","show_intro":"","show_category":"1","link_category":"1","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 3, '', '', 1, 17, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(67, 168, 'Hva er nytt i 1.5?', 'hva-er-nytt-i-15', '', '<p>Som ved tidligere utgivelser, gir Joomla! en samlet og enkel struktur for √• vise nettsider av alle typer. For √• f√∏lge den tekniske utviklingen av Internett, krevdes det en vesentlig omorganisering av Joomla!-kjernens funksjonalitet og vi brukte denne muligheten til √• forenkle mange av utfordringene som er i dagens brukergrensesnitt. Joomla! har mange nye trekk.</p>\r\n', '\r\n<p>M√•let med utgivelse av Joomla! 1.5 er:</p>\r\n<ul>\r\n<li>\r\n<p>Betraktelig forbedret anvendelighet, p√•virkelighet og m√•lomr√•det langt utover den originale Mambo forankringen.</p>\r\n</li>\r\n<li>\r\n<p>Utvide tilgjengelighet for √• st√∏tte internasjonalisering, dobbeltbyte-tegn og h√∏yre-til-venste st√∏tte for spr√•kene arabisk, farsi og hebraisk blant annet.</p>\r\n</li>\r\n<li>\r\n<p>Utvide integrasjonen med eksterne applikasjoner gjennom nettjenere og ekstern verifikasjon slik som Lightweight Directory Access Protocol (LDAP).</p>\r\n</li>\r\n<li>\r\n<p>Forsterket yteevne, nettstedsmaler og presentasjonsmuligheter for √• st√∏tte tilgjengelighetsstandarder og levere innhold til hvilket som helst bestemmelsessted.</p>\r\n</li>\r\n<li>\r\n<p>Oppn√• mer utholdelig og fleksibel struktur for utviklere av komponenter og utvidelser.</p>\r\n</li>\r\n<li>\r\n<p>V√¶re bakoverkompatibel med tidligere versjoner av komponenter, maler, moduler og andre utvidelser.</p>\r\n</li>\r\n</ul>', 2, 0, 0, 9, '2011-01-01 00:00:01', 42, 'Joomla! 1.5', '2011-01-15 23:17:52', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 0, '', '', 1, 15, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(68, 170, 'Bekreftelsekode', 'bekreftelsekode', '', '<p>Programtillegg for bekreftelsekode brukes for √• forhindre s√∏ppelinnsendinger/-registreringer i dine skjema som f.eks. registrerings-, kontakt- og innloggingsskjema. Din grunninstallasjon av Joomla inkluderer et programtillegg for bekreftelsekode som benytter tjenesten ReCaptcha¬Æ, men du kan ogs√• installere andre programtillegg for andre systemer for bekreftelsekode.</p>\r\n<p>Standard aktivert:</p>\r\n<ul>\r\n<li>ReCaptcha-<a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;amp;keyref=Help17:Extensions_Plugin_Manager_Edit">hjelp</a></li>\r\n</ul>\r\n<p>Merk: ReCaptcha er et registrert varemerke eid av Google Inc., og er et  selvstendig produkt som ikke er assosiert med, eller st√∏ttet av Joomla-prosjektet. Du m√• registrere deg, samt akseptere betingelsen, p√• Recaptcha.net ‚Äì for √• kunne bruke dette programtillegget. Utfyllende instruksjoner er tilgjengelig om du redigerer programtillegget for ReCaptcha under \'Utvidelser - Programtillegg\' i administrasjonen.</p>', '', 1, 0, 0, 25, '2012-01-17 03:20:45', 42, 'Joomla!', '2012-01-17 03:35:46', 42, 0, '0000-00-00 00:00:00', '2012-01-17 03:20:45', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":"","urlatext":"","targeta":"","urlb":"","urlbtext":"","targetb":"","urlc":"","urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 1, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(69, 171, 'Hurtigknapper', 'hurtigknapper', '', '<p>Programtilleggruppen hurtigknapper brukes for √• vise varsler om oppdateringer for Joomla eller utvidelser, som man b√∏r oppdatere til. Disse varslene vises i adminsitrasjonens kontrollpanel, som er den f√∏rste siden du ser etter √• ha logget p√• nettstedets administrasjon.</p>\r\n<p>Standard aktivert:</p>\r\n<ul>\r\n<li>Hurtigknapp - Oppdateringsvarsel for Joomla-utvidelser - <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;amp;keyref=Help17:Extensions_Plugin_Manager_Edit">Hjelp</a>.</li>\r\n<li>Hurtigknapp - Oppdateringsvarsel for Joomla! - <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;amp;keyref=Help17:Extensions_Plugin_Manager_Edit">Hjelp</a></li>\r\n</ul>', '', 1, 0, 0, 25, '2012-01-17 03:27:39', 42, 'Joomla!', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2012-01-17 03:27:39', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":"","urlatext":"","targeta":"","urlb":"","urlbtext":"","targetb":"","urlc":"","urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 0, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(70, 170, 'Smarts√∏k', 'smartsok', '', '<p>Denne modulen tilbyr s√∏k ved bruk av \'Smarts√∏k\'-komponenten. Du b√∏r bare bruke den om du har indeksert ditt innhold, samt at du har aktivert programtillegget \'Innhold - Smarts√∏k\', eller manuelt holder din sides indeks oppdatert. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;amp;keyref=Help25:Extensions_Module_Manager_Smart_Search">Hjelp</a>.</p>\r\n<div class="sample-module">{loadmodule finder,Smart Search}</div>', '', 1, 0, 0, 67, '2012-01-17 03:42:36', 42, '', '2012-01-17 16:15:48', 42, 0, '0000-00-00 00:00:00', '2012-01-17 03:42:36', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":"","urlatext":"","targeta":"","urlb":"","urlbtext":"","targetb":"","urlc":"","urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 10, 0, 0, '', '', 1, 13, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
