(68, 'Om parkene', '', '<p>Parksidene er utformet som et enkelt nettsted som kan bli oppdatert fra brukersiden av Joomla!</p>\r\n<p>Nettstedet er i stor grad fokusert som en bloggside som kan oppdateres ved hjelp av innsending av artikler fra brukersiden.</p>\r\n<p>Nye lenker kan ogs√• legges til fra brukersiden.</p>\r\n<p>Et enkel bildegalleri bruker com_content med miniatyrbilder som vises i en bloggutforming og bilder i full st√∏rrelse vist i artikkelutformingen.</p>\r\n<p>Park nettstedet demonstrere modulen spr√•kbytter. Alt innhold og moduler er merket som engelsk (nb-NO). Hvis en annen spr√•kpakke med eksempeldata legges til kan dette bli filtrert ved hjelp av spr√•kbytteren.</p>\r\n<p>Parksiden bruker HTML5 som er en viktig nettstandard (sammen med XHTML som brukes i andre omr√•der av eksempeldata).</p>', 2, 'position-4', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
